import React, { useState, useEffect } from "react";
import axios from "axios"; // Importer Axios
import "../styles/AdminOrg.css";
import eventIcon from "../assets/events.png";
import organizerIcon from "../assets/organizers.png";
import reportIcon from "../assets/generate.png";
import logoutIcon from "../assets/logout.png";
import profilePic from "../assets/user.png";
import logoIcon from "../assets/logo.png";

const AdminOrg = () => {
    const [events, setEvents] = useState([]);

    // Fonction pour rÃ©cupÃ©rer les Ã©vÃ©nements
    const fetchEvents = () => {
        // RÃ©cupÃ©rer le token depuis le localStorage
        const token = localStorage.getItem("token");

        if (token) {
            // Utilisation d'Axios pour envoyer une requÃªte GET Ã  l'API
            axios.get("https://ton-api.com/events", {
                headers: {
                    "Authorization": `Bearer ${token}` // Ajouter le token dans l'en-tÃªte de la requÃªte
                }
            })
                .then(response => {
                    console.log("Events fetched successfully:", response.data);
                    setEvents(response.data); // Mettre Ã  jour les Ã©vÃ©nements dans le state
                })
                .catch(error => {
                    console.error("There was an error fetching the events:", error);
                });
        } else {
            console.error("Token not found. Please log in again.");
        }
    };

    // Utilisation de useEffect pour rÃ©cupÃ©rer les Ã©vÃ©nements lors du montage du composant
    useEffect(() => {
        fetchEvents();
    }, []);

    return (
        <div className="admin-container">
            {/* Sidebar */}
            <aside className="sidebar">
                <div className="logo-container">
                    <img src={logoIcon} alt="logo" className="logo-icon" />
                    <span className="logo-text">MYCERTS</span>
                </div>
                <nav>
                    <ul>
                        <li>
                            <img src={eventIcon} alt="Events" />
                            <span>My Events</span>
                        </li>
                        <li className="active">
                            <img src={organizerIcon} alt="Organizers" />
                            <span>Participants</span>
                        </li>
                    </ul>
                </nav>
                <button className="logout-btn">
                    <img src={logoutIcon} alt="Log Out" />
                    <span>Log Out</span>
                </button>
            </aside>

            {/* Main Content */}
            <main className="content">
                {/* Header */}
                <div className="header">
                    <h2>ðŸ“… <span>My Events</span></h2>
                    <div className="profile">
                        <span>ORG. Amine</span>
                        <img src={profilePic} alt="Admin Profile" />
                    </div>
                </div>

                {/* Event List */}
                <div className="event-list-container">
                    <h3>Upcoming Events</h3>
                    {events.length > 0 ? (
                        <ul className="event-list">
                            {events.map((event) => (
                                <li key={event.id} className="event-item">
                                    <h4>{event.title}</h4>
                                    <p>{event.date}</p>
                                    <button className="view-details-btn">View Details</button>
                                </li>
                            ))}
                        </ul>
                    ) : (
                        <p>No events available.</p>
                    )}
                </div>
            </main>
        </div>
    );
};

export default AdminOrg;
